  "text" : "\uB108\uBB34 \uD22C\uBA85\uD55C \uC0AC\uB78C, \uC124\uB4DD\uC744 \uD560 \uC218 \uC5C6\uB294 \uC0AC\uB78C\uC740 \uBBF8\uC6C0\uC744 \uBC1B\uB294\uB2E4. \uB208\uBA3C\uC790\uC758 \uB3C4\uC2DC\uC5D0\uC11C \uC138\uC0C1\uC744 \uBCFC \uC218 \uC788\uB294 \uC0AC\uB78C\uC774 \uC7A5\uC560\uC778\uC778\uAC83\uCC98\uB7FC \uBD80\uD328\uD55C \uC138\uC0C1\uC5D0\uC11C \uD22C\uBA85\uD55C \uC0AC\uB78C\uC740 \uC788\uC5B4\uC11C\uB294 \uC548\uB418\uB294 \uC0AC\uB78C\uC774\uB2E4. \uD22C\uBA85\uD558\uC9C0 \uBABB\uD55C \uC0AC\uB78C\uC740 \uC18C\uC2E0, \uC9C0\uC870\uB77C\uB294 \uAC74 \uC774\uD574\uB97C \uBABB\uD55C\uB2E4.",
