  "text" : "\uCD08\uACE0\uC18D \uB9AC\uADF8\uB808\uC158 \uD14C\uC2A4\uD2B8\uB97C \uAC70\uC758 \uB05D\uB0B4\uACE0 \uB0B4\uC77C\uC740 \uC624\uC804\uC5D0\uB294 \uC544\uAC00 \uC608\uBC29\uC811\uC885\uC73C\uB85C \uBC18\uCC28\uB85C\uAD70\uC694.. \uC810\uC2EC\uC774\uB098 \uBA39\uACE0 \uCD9C\uADFC\uD560 \uC218 \uC788\uC744\uAE4C\uC694? \uB0B4\uC77C\uB3C4 \uC57C\uADFC\uC77C\uD150\uB370.. \uB9AC\uADF8\uB808\uC158 \uD14C\uC2A4\uD2B8 \uACB0\uACFC\uB294 \uC804\uD654\uB85C \uC2B9\uBD80\uB97C \uBD10\uC57C\uD560\uB4EF.. \uACB0\uD568\uBCF4\uACE0\uC11C \uC798 \uC4F0\uB294 \uAE30\uC220 \uC5F0\uB9C8\uB294 \uB05D\uC774 \uC5C6\uB294 \uB4EF..",
