  "id_str" : "8894756773",
  "text" : "\uC804 \uD14C\uC2A4\uD130\uAC00 \uD14C\uC2A4\uD2B8\uB9CC \uC798\uD574\uC11C\uB294 \uD76C\uB9DD\uC774 \uC5C6\uB2E4\uACE0 \uBD05\uB2C8\uB2E4. \uADF8\uB9AC\uACE0 \uD14C\uC2A4\uD2B8\uB9CC \uC218\uD589\uD558\uB294 \uD14C\uC2A4\uD130\uAC00 \uB530\uB85C \uC874\uD574\uD558\uB294 \uAC83\uB3C4 \uC88B\uC9C0 \uC54A\uB2E4\uACE0 \uBD05\uB2C8\uB2E4. \uC911\uC694\uD55C \uAC83\uC740 \uC870\uC9C1 \uC804\uCCB4\uC758 \uBAA8\uB4E0 \uAD6C\uC131\uC6D0\uC774 \uD14C\uC2A4\uD2B8\uB97C \uBA3C\uC800 \uC0DD\uAC01\uD574\uC57C\uD55C\uB2E4\uACE0 \uC0DD\uAC01\uD569\uB2C8\uB2E4.",
