  "text" : "\uAE30\uD68D\uC744 \uD560\uB54C\uB3C4 \uC0AC\uC6A9\uC790 \uC870\uC0AC\uB97C \uD560 \uB54C\uB3C4 \uAC1C\uBC1C\uC744 \uD560 \uB54C\uB3C4 \uB9C8\uCF00\uD305\uC744 \uD560 \uB54C\uB3C4 \uBAA8\uB4E0 \uC8FC\uCCB4\uB4E4\uC774 \uC6B0\uB9AC\uAC00 \uC9C0\uAE08 \uD558\uB294 \uC791\uC5C5\uC774 \uACFC\uC5F0 \uD14C\uC2A4\uD2B8 \uAC00\uB2A5\uD55C \uAC83\uC778\uAC00\uB97C \uBA3C\uC800 \uACE0\uBBFC\uD574\uC57C\uD55C\uB2E4\uACE0 \uC0DD\uAC01\uD569\uB2C8\uB2E4. \uADF8\uB798\uC11C \uC804 \uB354 \uB9CE\uC740 \uC0AC\uB78C\uC744 \uB9CC\uB098\uACE0 \uC774\uC57C\uAE30\uD558\uACE0 \uC2F6\uC5C8\uC2B5\uB2C8\uB2E4.",
