  "id_str" : "8668704464",
  "text" : "\uAD6C\uAE00 \uD14D\uD050\uB294 \uB9D0\uB9CC \uAD6C\uAE00\uC758 \uC11C\uBE44\uC2A4\uC774\uC9C0 \uC5B4\uB5A4 \uAD6C\uAE00\uC758 \uC11C\uBE44\uC2A4\uC640\uB3C4 \uC81C\uB300\uB85C \uC5F0\uB3D9\uC774 \uB418\uC9C0 \uC54A\uB294\uB2E4.. \uC720\uD22C\uBE0C\uB098 \uAC80\uC0C9 \uB9D0\uACE0 \uC5F0\uB3D9 \uB418\uB294\uAC8C \uBA38\uAC00 \uC788\uB294\uAC74\uC9C0. \uBE14\uB85C\uAC70\uC758 \uC808\uBC18\uB9CC\uD07C\uC774\uB77C\uB3C4 \uC2E0\uACBD \uC880 \uC368\uC8FC\uC5C8\uC73C\uBA74 \uD55C\uB2E4. \uB0B4\uAC00 \uC6D0\uD558\uB294\uAC74 \uC9C0\uBA54\uC77C\uC758 \uBA54\uC77C\uC744 \uBE14\uB85C\uADF8\uB85C \uBCF4\uB0BC \uC218 \uC788\uC5C8\uC73C\uBA74..",
