  "id_str" : "8668795152",
  "text" : "\uACE0\uAC1D\uC774\uB780 \uBAA8\uC9D1\uB2E8\uC744 \uCD94\uC815\uD55C\uB2E4\uB294\uAC74 \uBD88\uAC00\uB2A5\uD560\uC9C0\uB3C4 \uBAA8\uB978\uB2E4. \uACE0\uAC1D\uC774\uB780 \uD3C9\uC0DD\uC744 \uD0D0\uAD6C\uD574\uB3C4 \uC808\uB300 \uC54C\uC544\uB0BC\uC218 \uC5C6\uB294 \uC2E0\uC758 \uC601\uC5ED\uC77C\uC218\uB3C4 \uC788\uB2E4. \uADF8\uB807\uB2E4\uACE0 \uC190\uB193\uACE0 \uB7EC\uC2DC\uC548\uB8F0\uB81B\uC2DD\uC73C\uB85C \uC81C\uD488 \uAC1C\uBC1C\uD558\uBA74 99%\uC758 \uC21C\uB3C4\uB85C \uB9DD\uD55C\uB2E4..",
