  "id_str" : "8668822369",
  "text" : "\uC911\uC694\uD55C \uAC83\uC740 \uACE0\uAC1D\uC758 \uC81C\uC57D\uC774\uB2E4. \uADF8\uBCF4\uB2E4 \uBA3C\uC800 \uD560 \uC77C\uC740 \uACFC\uC5F0 \uC6B0\uB9AC\uAC00 \uB204\uAD6C\uB97C \uC704\uD574 \uC81C\uD488\uC744 \uAC1C\uBC1C\uD560 \uAC83\uC778\uAC00\uC774\uB2E4. \uB9CE\uC740 \uAE30\uC5C5\uB4E4\uC774 \uC790\uC2E0\uB4E4\uC758 \uACE0\uAC1D\uCE35\uC870\uCC28 \uC81C\uB300\uB85C \uC774\uD574\uD558\uC9C0 \uBABB\uD558\uB294 \uACBD\uC6B0\uAC00 \uB9CE\uB2E4. \uD2B9\uC218\uD55C \uACBD\uC6B0\uB97C \uBE7C\uACE0 \uACE0\uAC1D\uCE35\uC744 \uC120\uC815\uD558\uC9C0 \uBABB\uD560 \uACBD\uC6B0\uB294 \uB9CE\uC9C0 \uC54A\uB2E4.",
