  "text" : "\uD2B9\uC815\uD55C \uACE0\uAC1D\uCE35, \uC6B0\uB9AC\uAC00 \uC9D1\uC911\uD574\uC57C\uD560 \uACE0\uAC1D\uCE35\uC774 \uBA85\uD655\uD574 \uC9C4\uB2E4\uBA74 \uADF8\uB4E4\uC774 \uACAA\uB294 \uAD34\uB85C\uC6C0, \uC808\uB9DD\uAC10\uC744 \uD30C\uD5E4\uCE58\uC790. \uACE0\uAC1D\uC740 \uC790\uC2E0\uC774 \uC6D0\uD558\uB294 \uAC83\uC740 \uBAB0\uB77C\uB3C4 \uC790\uC2E0\uC774 \uC5B4\uB835\uACE0 \uD798\uB4E0 \uAC83\uC740 \uB108\uBB34 \uC798\uC548\uB2E4. \uACE0\uAC1D\uC774 \uC6D0\uD558\uB294 \uAC83\uC744 \uB9CC\uB4E4\uB824 \uD558\uC9C0 \uB9D0\uACE0 \uACE0\uAC1D\uC774 \uD798\uB4E4\uACE0 \uC5B4\uB824\uC6CC \uD558\uB294 \uAC83\uC744 \uB9CC\uB4E4\uC790.",
