  "text" : "\uACF5\uAE30\uC5C5\uC758 \uC81C\uC77C \uBAA9\uD45C\uB294 \uC774\uC724\uCD94\uAD6C\uAC00 \uC544\uB2C8\uB77C \uC11C\uBE44\uC2A4\uC758 \uBD84\uBC30\uC774\uB2E4. \uC6B0\uB9AC \uB098\uB77C \uC18C\uB4DD \uBD88\uADE0\uD615\uC758 \uC81C\uC77C \uC6D0\uC778\uC740 \uACF5\uAE30\uC5C5\uC744 \uC774\uC724 \uCD94\uAD6C\uC758 \uCC99\uB3C4\uB85C \uD3C9\uAC00\uD558\uAE30 \uB54C\uBB38\uC774\uB2E4. \uD55C\uC804, \uC218\uB3C4\uACF5\uC0AC \uB4F1\uC758 \uACF5\uAE30\uC5C5\uC740 \uC0AC\uAE30\uC5C5\uC758 \uC774\uC775\uC744 \uB04C\uC5B4\uB2E4\uAC00 \uC800\uC18C\uB4DD\uCE35\uC5D0 \uC11C\uBE44\uC2A4\uB97C \uBD84\uBC30\uD558\uB294 \uAC83\uC774 \uC81C\uC77C \uBAA9\uD45C\uC774\uB2E4.",
